/* eslint-disable no-unused-vars */
import React, { memo } from 'react'
import { makeStyles } from '@material-ui/core/styles';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import PropTypes from 'prop-types'
import { Grid, Skeleton } from '../../../components'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCheck } from '@fortawesome/free-solid-svg-icons';

import Card from './Card'

const useStyles = makeStyles({
  root: {
    maxWidth: 300,

  },
  media: {
    height: 140,
  },
});


function Board({ data }) {
  const { cases, todayDeaths, recovered, deaths, todayCases } = data

  const getValue = (value) => value ? value : <Skeleton variant="text" width={182} height={60} />
  const classes = useStyles();


  return (
    <Grid container spacing={4}>
      <Grid item xs={12} md={3}>
      <Card value={661} label="Confirmados" color="#5d78ff" />

      </Grid>
      <Grid item xs={12} md={3}>
        <Card value={90} label="Isolamento" color="#F7B829" />
      </Grid>
      <Grid item xs={12} md={3}>
        <Card value={4} label="Internados" color="#000" />
      </Grid>
      <Grid item xs={12} md={3}>
        <Card value={14} label="Ã“bitos" color="#E95078" />
      </Grid>
      <Grid item xs={12} md={3}>
        <Card value={553} label="Recuperados" color="#67C887" />
      </Grid>
      <Card className={classes.root}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image="/static/images/cards/contemplative-reptile.jpg"
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
            Lizard
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
            Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
            across all continents except Antarctica
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          Share
        </Button>
        <Button size="small" color="primary">
          Learn More
        </Button>
      </CardActions>
    </Card>
    </Grid>
  )
}

export default memo(Board)
